    <div class="container">
        <div class="row">
            <div class="col-md-6">
                <p>Left side content</p>
            </div>
            <div class="col-md-6">
                <p>Right side content</p>
            </div>
        </div>
    </div>
</footer>

<style>
    footer {
        background-color: #333;
        color: #fff;
        padding: 20px 0;
    }

    .container {
        max-width: 960px;
        margin: 0 auto;
    }

    .row {
        display: flex;
        flex-wrap: wrap;
        justify-content: space-between;
    }

    .col-md-6 {
        width: 50%;
        padding: 0 15px;
    }

    p {
        margin: 0;
    }
</style>
